import { Container, GuiasContainer } from "./styles";


function Header(){
    return(
        <Container>
            <GuiasContainer>
                <button>Início</button>
                <button>André Tamião</button>
                <button>Contato</button>
            </GuiasContainer>
        </Container>
    )
}

export default Header;
